import React, { Component } from 'react'

export default class Repositories extends Component {

    constructor(props){
        super(props);
        var repositories
        let repos

        this.state = {
            repositories: localStorage.getItem('@Trinity/repositories'),
            repos: []

        }

    }


    FetchRepositories(){
        for (let i = 0; i < this.state.repositories; i++) {
            this.state.repos[i] = localStorage.getItem(`@Trinity/repo${i}`);
            console.log(this.state.repos[i]);
        }
    }

    render() {
        return (
            <div>
                {this.state.repos.map(repositorio=>(
                    <div key={repositorio.id}>
                        <div>
                            <h1>
                                {repositorio.name}
                            </h1>
                        </div>
                        <div>{repositorio.forks}</div>
                    </div>
                ))}
            </div>
        )
    }
}
